import makeStyles from '../styles/Header'

import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper'
import { useState, useEffect } from 'react'
import { Typography } from '@material-ui/core';
import { ThemeProvider, createMuiTheme } from '@material-ui/core/styles'
import Avatar from '@material-ui/core/Avatar';
import test from '../images/test.jpg'

const Header = () => {

    const styles = makeStyles()
    const theme = createMuiTheme({
        typography: {
            fontFamily: [
                'Inter',
            ].join(','),
            
        },

    })


    useEffect(() => {
        console.log(styles)
    })


    return (
        <ThemeProvider theme={theme}>
            <div>
                <Grid container spacing={3} className={styles.root} justify='space-between' alignItems='center' alignContent='center' >
                    <Grid item xs={3}>
                        <div className={styles.item_first}><Typography>Back</Typography></div>
                    </Grid>
                    <Grid item xs={3}>
                        <div><Typography className={styles.main}>Dashboard</Typography></div>
                    </Grid>
                    <Grid item xs={3}>
                        <div className={styles.item_login}><Avatar alt='Test' src={test}/></div>
                    </Grid>
                </Grid>
            </div>
        </ThemeProvider>
    )
}

export default Header
